INSERT INTO `News` (`id`, `title`, `text`, `active`, `roleId`, `createdAt`, `updatedAt`) VALUES
	(1, 'ТикТок портит качество видео?', 'Лови рекомендации, как снимать в хорошем качестве.\r\n\r\n1. Снимай на основную камеру. Это касается видео и в самом ТикТок и обычной камеры. Передняя (фронтальная) камера всегда хуже. Это может показаться неудобным, но ты быстро привыкнешь.\r\n\r\n2. Формат видео в ТикТок - 9:16. Если ты снимаешь на обычную камеру, зайти в любое приложение и измени формат.\r\n\r\n3. При сохранении видео из сторонних программ проверь их качество. Разрешение видео должно быть не меньше 1080. \r\n\r\n4. Не используй цветкор и фильтры. \r\n\r\nРек! 🔝', 1, 2, '2020-06-25 22:57:01', '2020-06-25 22:57:02'),
	(2, 'Лайфхак! Как снять видео на 1 миллион просмотров', 'Рассказываю на своем примере.\r\n\r\nЕсли вы видите успешный ролик с идеей, которой еще никто не делал - надо брать и повторять!\r\n\r\nУ нас в чате скинули сообщение, о том, что ролик быстро набирает просмотры. Я пошла сразу и сняла такой же.\r\n\r\nРезультат - 2,8млн просмотров.\r\n\r\nРек! 🔝', 1, 2, '2020-06-25 22:58:05', '2020-06-25 22:58:05');
